const Display = ({ goodVote, badVote, neutralVote, clickHistory }) => {
    if (clickHistory.length === 0) {
        return (<>
            <p>No feedback given.</p>
        </>
        )
    } else {
        return (
            <>
                <div>Good: {goodVote}</div>
                <div>Neutral: {neutralVote}</div>
                <div>Bad: {badVote}</div>
                <div>All: {clickHistory.length}</div>
                <div>Average: {(goodVote - badVote)/ clickHistory.length}</div>
                <div>Percentage: {goodVote/ clickHistory.length * 100}%</div>
            </>
        )
    }
}


export default Display
